B.ET=A.a(s(["Asseyez-vous avec 3 bi\xe8res entre les jambes, plac\xe9es en forme de triangle, face \xe0 l'adversaire ( pointant vers lui )","Ouvrez les bi\xe8res et mettez les capsules \xe0 l'envers afin qu'elles soient dans un \xe9tat d'\xe9quilibre sur les bi\xe8res","La distance entre votre premi\xe8re bi\xe8re et sa premi\xe8re bi\xe8re doit \xeatre de 1m et 92cm","Vous choisissez au hasard qui commence","Vous devez frapper les capsules adverses avec des capsules suppl\xe9mentaires, 1 coup \xe0 la fois","Vous avez le droit de jouer avec des capsules simples (plates) ou de les plier (pli\xe9es)","Lorsque vous touchez une capsule ou plusieurs, l'adversaire peut essayer de sauver","S'il riposte avec le m\xeame nombre ou plus de capsules que vous, c'est \xe0 vous d'essayer de sauver, etc...","S'il ne sauve pas, il doit boire 1/3 de la ou des bi\xe8res qui ont \xe9t\xe9 frapp\xe9es","Si un joueur est touch\xe9 pour 3 et en sauve 1, il n'en boit que 2, s'il en sauve 2, il n'en boit qu'1,...","Chaque bi\xe8re a 3 vies, ce qui fait 9 vies au total par joueur","Quand une bi\xe8re est vide, elle est hors jeu, il faut placer les 2 bi\xe8res restantes \xe0 la base de ce qui \xe9tait auparavant un triangle ","Quand une autre bi\xe8re est vide, il faut centrer la bi\xe8re restante","Lorsque la capsule rebondit devant le triangle des bi\xe8res (ex.\xa0: sur vos jambes ou au sol) et frappe les capsules sur les bi\xe8res, cela compte comme une touche","Quand la capsule rebondit apr\xe8s le triangle des bi\xe8res (ex. : sur le ventre) et frappe les capsules sur les bi\xe8res, cela ne compte pas comme une touche","Lorsque vous faites tomber vos capsules par erreur, vous pouvez les remettre en place, ainsi que si elles sont d\xe9plac\xe9es","Main de dieu\xa0:\n Lorsque la capsule rebondit n'importe o\xf9 et revient vers le joueur qui l'a tir\xe9e, il peut l'attraper et rejouer (m\xeame s'il a touch\xe9 une bi\xe8re avec),  avec la main avec laquelle il l'a attrap\xe9e, seulement s'il n'a pas \xe0 lever les fesses pour l'attraper (\xe0 port\xe9e de main)","Caps en argent : Il reste 2 vies \xe0 chaque joueur","Caps en or : Chaque joueur a 1 point de vie restant","Droit de pisse : Chaque \xe9quipe peut aller aux toilettes une fois dans un match","Il est interdit de bloquer les tirs adverses \xe0 tout moment et cela peut vous faire bannir de la ligue","2vs2 : vous \xeates autoris\xe9 \xe0 tirer sur n'importe quel adversaire","2vs2 : En 2vs2 les touches sont partag\xe9s : par exemple si tu te fais tirer dessus 1 fois et ton co\xe9quipier 2 fois, tu dois sauver 3 gorg\xe9es ou plus en \xe9quipe ","2vs2 : Si vous ne sauvez pas assez, vous choisissez en \xe9quipe comment vous allez r\xe9partir les gorg\xe9es au sein de l'\xe9quipe en fonction des bi\xe8res qui ont \xe9t\xe9 touch\xe9es","2vs2 : Zombie : \n Quand un joueur meurt, il ne tire plus, son partenaire est seul, jusqu'\xe0 ce que son partenaire soit touch\xe9, alors il est autoris\xe9 a tirer pour essayer de le sauver"]),t.s)
